description:
Nerve center and headquarters of Great Britain's criminal investigation system is the ancient building on the Thames embankment, known the world over as Scotland Yard. Just as famous is the quiet efficiency of the yard's corps of inspectors...among whose highly-trained ranks inspector John K. Farnsworth rates high. On a recent morning, an innocent-sounding phone call started Farnsworth off on one of his bizarre cases...


